test.geolocation = function() {

  function pausecomp(millis) {
    var date = new Date();
    var curDate = null;

    do { curDate = new Date(); }
    while(curDate-date < millis);
  }

  function getCurrentPosition(successCallback, errorCallback) {
    // pausecomp(2000);
    console.log("test - get current position");
    if (successCallback && typeof(successCallback) === "function") {
      successCallback(test.gpspoint);
    } else {
      console.log("SuccessCallback is not a function.", successCallback);
      errorCallback("test - error on get current position");
    }
  }

  function watchPosition(successCallback, errorCallback) {
    console.log("test - watch position");
    var date = new Date().getTime();
    var i = 0;
    function delayedLoop(){
      // console.log("delayedLoop");
      var pointgpx = test.gpstrack[i];
      var point = {};
      point.timestamp = date;
      point.coords = {};
      // console.log("pointgpx.latitude",pointgpx.latitude);
      point.coords.latitude = parseFloat(pointgpx.latitude);
      point.coords.longitude = parseFloat(pointgpx.longitude);
      point.coords.altitude = parseInt(pointgpx.coords.altitude, 10);
      point.coords.speed = parseInt(pointgpx.coords.speed, 10);
      point.coords.accuracy = parseInt(pointgpx.coords.accuracy, 10);
      point.coords.altitudeAccuracy = parseInt(pointgpx.coords.altitudeAccuracy, 10);
      point.coords.heading = 0;
      date = date + 1000;
      successCallback(point);
      // console.log("test - watch point", point);
      if (i++ == test.gpstrack.length) {
        window.clearTimeout(wait);
        return;
      }
      wait = window.setTimeout(delayedLoop, 1000);
    }
    delayedLoop();
    // errorCallback("test - error on watch position", test.gpstrack[i], i);
  }

  function clearWatch(id) {
    window.clearTimeout(wait);
  }

  function get_track() {
    trs = {};
    trs.date = new Date().toISOString();
    trs.trackid = trs.date;
    var year = new Date().getFullYear();
    var month = new Date().getMonth();
    var day = new Date().getDate();
    var hour = new Date().getHours();
    var min = new Date().getMinutes();
    var sec = new Date().getSeconds();
    trs.name = "TR-"+year+month+day+"-"+hour+min+sec;
    trs.duration = 0;
    trs.distance = 0;
    trs.data = [];
    var olat = 0;
    var olon = 0;
    var last_point = null;

    //~ var tr = [];
    var date = new Date().getTime();
    for (i = 0; i < test.gpstrack.length; i++) {
      var pointgpx = test.gpstrack[i];
      var point = {};
      point.timestamp = date;
      point.coords = {};
      //~ console.log("pointgpx.latitude",pointgpx.latitude);
      point.coords.latitude = parseFloat(pointgpx.latitude);
      point.coords.longitude = parseFloat(pointgpx.longitude);

      var alt = parseInt(pointgpx.coords.altitude, 10);
      if (alt < -200 || (alt === 0 && vertAccuracy === 0)) {
        alt = null;
      }
      point.coords.altitude = alt;
      point.coords.speed = parseInt(pointgpx.coords.speed, 10);
      point.coords.accuracy = parseInt(pointgpx.coords.accuracy, 10);
      point.coords.altitudeAccuracy = parseInt(pointgpx.coords.altitudeAccuracy, 10);
      point.coords.heading = 0;

      //~ console.log("lat", parseFloat(pointgpx.latitude));
      // calculate distance
      if (last_point !== null) {
        trs.distance += testgeo.t_distance_from_prev(olat, olon, point.coords.latitude, point.coords.longitude);
        //~ console.log("testgeo.t_distance_from_prev", testgeo.t_distance_from_prev(olat, olon, point.coords.latitude, point.coords.longitude));
      } else {console.log("first ?");}
      trs.duration += 1000;

      date = date + 1000;
      trs.data.push(point);
      olat = point.coords.latitude;
      olon = point.coords.longitude;
      last_point = 1;
    }
    console.log("trs.distance", current_track.distance);
    console.log("trs.date", trs.date);
    console.log("trs.data length", trs.data.length);
    return trs;
  }

  function t_distance_from_prev(lat1, lon1, lat2, lon2) {
    var lat1Rad = lat1*( Math.PI / 180);
    var lon1Rad = lon1*( Math.PI / 180);
    var lat2Rad = lat2*( Math.PI / 180);
    var lon2Rad = lon2*( Math.PI / 180);

    var dLat = lat2Rad - lat1Rad;
    var dLon = lon2Rad - lon1Rad;

    var a = Math.sin(dLat/2) * Math.sin(dLat/2) + Math.cos(lat1Rad) * Math.cos(lat2Rad) * Math.sin(dLon/2) * Math.sin(dLon/2);
    var c = 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1-a));
    var R = 6371 * 1000;
    return R * c;
  }

  return {
    getCurrentPosition: getCurrentPosition,
    watchPosition: watchPosition,
    clearWatch: clearWatch
  };

}();


